import PropTypes from 'prop-types';

import { StyledButton } from './styles';

export default function Button() {
  return (
    <StyledButton />
  );
}

Button.propTypes = {
  type: PropTypes.string,
  disabled: PropTypes.bool,
  isLoading: PropTypes.bool,
};

Button.defaultProps = {
  type: 'button',
  disabled: false,
  isLoading: false,
};
